INSERT INTO `status` (`id`, `code`, `type`, `short_description`, `responsibilty`, `detailed_description`, `available_in`) VALUES (1,'ACSBL_01','Outdated','Article in master data validation','Zalando','Wait','ASR'),(2,'ACSBL_02','Backlog','Article in master data validation','Zalando','Wait','ASR'),(3,'ACSPRO_01','Outdated','Not in use anymore','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(4,'ACSREJ_01','in use','Size not available in selected size chart','Partner','Your supplier size is not available in the size chart. Choose another size chart or ask Zalando Partner Program to add the missing size to the size chart.','ASR + onboarding tracker'),(5,'ACSREJ_02','in use','Wrong size chart','Partner','EAN rejected, because a detail of size chart is wrong(e.g. size chart states \"accessories\", but images and content show a shoe). Please adjust accordingly.','ASR + onboarding tracker'),(6,'ACSREJ_03','outdated','Not in use anymore','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(7,'ACSREJ_04','outdated','Not in use anymore','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(8,'ACSREJ_05','in use','Wrong brand','Partner','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(9,'ACSREJ_06','outdated','Not in use anymore','none','','ASR + onboarding tracker'),(10,'ACSREJ_07','outdated','','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(11,'ACSREJ_08','in use','Length not available in selected length chart','Partner','EAN rejected, because submitted length size is not included in the selected length chart(e.g. length chart includes sizes from 10 to 20 | submitted length \"22\" not included).','ASR + onboarding tracker'),(12,'ACSREJ_09','outdated','No length allocation possible','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(13,'ACSREJ_10','in use','Wrong length chart','Partner','EAN rejected, because a detail (gender, age group, commodity group, brand) of length chart is wrong(e.g. size chart states \"accessories\", but images and content show a shoe). Please adjust accordingly.','ASR + onboarding tracker'),(14,'ACSREJ_11','in use','Length chart missing','Partner','EAN rejected, because the length chart was not submitted. Please submit a length chart.','ASR + onboarding tracker'),(15,'ACSREJ_12','in use','Selected article color does not match image','Partner','EAN rejected, because the color name differs from the color of the images or the identical color name was assigned to two different articles. Please adjust accordingly.','ASR + onboarding tracker'),(16,'ACSREJ_13','outdated','Not in use anymore','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(17,'ACSREJ_14','outdated','Not in use anymore','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(18,'ACSREJ_15','in use','Commodity group not allowed','Partner','EAN rejected, because article information is not allowed/not present. Please see the Onboarding Tracker comment.','ASR + onboarding tracker'),(19,'ACSREJ_16','in use','Brand not allowed','Partner','EAN rejected, because the selected brand is not allowed. Please reach out to your dedicated Operations Specialist.','ASR + onboarding tracker'),(20,'ACSREJ_17','in use','Article already existing','Partner','EAN rejected, because the model ID of this article is in use for a different article. Please reach out to your dedicated Operations Specialist.','ASR + onboarding tracker'),(21,'ACSREJ_18','in use','Article from old season','Partner','Check the article season or deactivate the article. Ask Zalando Partner Program for further guidance on the seasonal process.','ASR + onboarding tracker'),(22,'ACSREJ_19','in use','Images show different articles','Partner','EAN rejected, because the images show several different articles (e.g. packshot shows a shirt | model views show only trousers). Please adjust accordingly.','ASR + onboarding tracker'),(23,'ACSREJ_20','in use','Model does not meet Zalando requirements','Partner','EAN rejected, because the model images are not compliant with Zalando Model guidelines. Please submit corrected images.','ASR + onboarding tracker'),(24,'ACSREJ_21','in use','Images and article data do not match','Partner','EAN rejected, because the description and other content provided does not match the images(e.g. content describes trousers | images show a shirt). Please review submitted data.','ASR + onboarding tracker'),(25,'ACSREJ_22','in use','Article already existing','Partner','EAN rejected, because the submitted article is already available on a different model ID(e.g. article already available on model ID 1234, please move the sent EANs to 1234 model ID).','ASR + onboarding tracker'),(26,'ACSREJ_23','in use','First view does not meet Zalando requirements','Partner','EAN rejected, because the first view does not meet Zalando requirements. Please submit correct first view image.','ASR + onboarding tracker'),(27,'ACSREJ_24','in use','Depicted article does not meet Zalando requirements','Partner','Change the images according to the Zalando Partner Program Image Guidelines as the depicted article cannot be used that way or deactivate the article.','ASR + onboarding tracker'),(28,'ACSREJ_25','in use','Season not allowed','Partner','Check the season or deactivate the article. Ask Zalando Partner Program for further guidance about the season process.','ASR + onboarding tracker'),(29,'ACSREJ_26','in use','Not enough sizes','Partner','EAN rejected, because the minimum (3 consecutive sizes for apparel and 5 for footwear) amount of sizes was not submitted. Please check if enough consecutive sizes with stock are transmitted; if so, please mark the article as corrected and ask your operations manager to trigger the re-import.','ASR + onboarding tracker'),(30,'ACSREJ_27','in use','Size run incomplete','Partner','EAN rejected, because the submitted size run is incomplete(e.g.: XS, S, XXL). Please submit at least 5 consecutive sizes for footwear/3 for apparel.','ASR + onboarding tracker'),(31,'ACSREJ_28','in use','Gender inconstency within article data','Partner','Check your article data Within any possible values there is an indication for different age groups there is an indication for different genders. For example, male has been selected but women mentioned in the article description.','ASR + onboarding tracker'),(32,'ACSREJ_29','in use','Age inconstency within article data','Partner','Check your article data Within any possible values there is an indication for different age groups. For example, adult has been mapped but in the article description is mentioned kids.','ASR + onboarding tracker'),(33,'ACSREJ_30','in use','Silhoutte does not match picture or article data','Partner','Compare selected silhouette with images or content of article. They do not match with each other. If the images and content are correct, change the silhoutte accordingly.','ASR + onboarding tracker'),(34,'ACSREJ_31','outdated','Not in use anymore','none','In case: Ask Zalando Partner Program why this error occured.','ASR + onboarding tracker'),(35,'ACSREJ_32','in use','Background does not meet Zalando requirements','Partner','EAN rejected, because the background color does not meet Zalando requirements. Please submit corrected images that meets Zalando guidelines.','ASR + onboarding tracker'),(36,'ACSREJ_33','in use','Mandatory images missing','Partner','EAN rejected, because the mandatory images are missing. Please submit missing images.','ASR + onboarding tracker'),(37,'ACSREJ_34','in use','Inner backview missing from packshot','Partner','EAN rejected, because the inner backview is missing from the packshot. Please submit corrected images.','ASR + onboarding tracker'),(38,'ACSREJ_35','in use','Manneqiun visible on packshot','Partner','EAN rejected, because the mannequin is visible on the packshot. Please remove the mannequin from the article packshot.','ASR + onboarding tracker'),(39,'ACSREJ_36','in use','Color differences between images','Partner','EAN rejected, because the images show the same article in different colors. Please only send the images for the article\'s supplier color.','ASR + onboarding tracker'),(40,'ACSREJ_37','in use','Reflections or shadows','Partner','EAN rejected, because the mandatory images shows a reflection/shadow. Please submit corrected images.','ASR + onboarding tracker'),(41,'ACSREJ_38','in use','Article laid out flat in article image','Partner','EAN rejected, because the adult textile\'s packshot is laid out flat. Please shoot article on a mannequin and submit corrected images.','ASR + onboarding tracker'),(42,'ACSREJ_39','in use','Article not centered in article image','Partner','Check all images and change the alignment of the wrong one so that the article is centered or deactivate the article.','ASR + onboarding tracker'),(43,'ACSREJ_40','in use','Sports size chart missing','Partner','EAN rejected, because it is a sports article, but a sport size chart was not submitted. Please provide a correct size chart.','ASR + onboarding tracker'),(44,'ACSREJ_41','in use','Size chart gender does not match selected article gender','Partner','EAN rejected, because the size chart name includes a different gender than the content/images. Please provide correct size chart.','ASR + onboarding tracker'),(45,'ACSREJ_42','in use','One Size size chart missing','Partner','EAN rejected, because the article is a one size article submitted with a size chart for multiple sizes(S,M,L). Please submit a OneSize size chart.','ASR + onboarding tracker'),(46,'ACSREJ_43','in use','Supplier size delimiter wrong','Partner','EAN rejected, because the sizes are submitted with a wrong format/delimiter(e.g. size 4,5 provided | size chart only includes